  return (
    <Container className="App">
        <Row>
        <Col xs={2}></Col>
        <Col xs={8}>
            <img src="/images/afia.png" alt="logo" style={{width:'100px', padding:5}} />
        </Col>
        <Col xs={2}></Col>
        </Row>

    </Container>
  );
}

export default Header;
